import { React, useEffect, useState, useCallback } from "react";
import "./index.css"
import LoggedPage from "../LoggedPage";

function SignUp() {
    const [userName, setUsername] = useState("");
    const [passWord, setPassword] = useState("");
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [error, setError] = useState("");
    const [approved, setApproved] = useState(false);
    const [privateId, setPrivateId] = useState("");


    const handleOnChangeFirstName = (event) => {
        setFirstName(event.target.value);

    };
    const handleOnChangeLastname = (event) => {
        setLastName(event.target.value);

    };

    const handleOnChangeUserName = (event) => {
        setUsername(event.target.value);

    };
    const handleOnChangePassword = (event) => {

        setPassword(event.target.value);
    };
    function erroDisplay() {
        if (firstName.length <= 0 || lastName.length <= 0 || userName.length < 5 || passWord.length < 4) {

            return setError("Please length of the userName needs to be more than 5, lenght of passWord needs to be more than 5")
        }
        else{
            setApproved(true);
        }
    }

    console.log("userName: " + userName);
    //   console.log("passWord: " + passWord);
    return (
        <div id="signUpContainer">

            <div className="signTittle">SignUp To selfManagnment</div>

            <div className="signUpBlockContainer">
                <div className="signUpFirstname">FirstName:
                    <input
                        type="text"
                        name="signFirstValue"
                        placeholder="firstName"
                        onChange={handleOnChangeFirstName}
                    /> </div>

                <div className="signUpLastName">LastName:
                    <input
                        type="text"
                        name="signLastValue"
                        placeholder="lastName"
                        onChange={handleOnChangeLastname}
                    /> </div>

                <div className="signUpUsername">UserName:
                    <input
                        type="text"
                        name="signUserNameValue"
                        placeholder="userName"
                        onChange={handleOnChangeUserName}
                    /> </div>

                <div className="signUpPassword">PassWord: <input
                    name="signUpPassWordValue"
                    type="text"
                    placeholder="password"
                    onChange={handleOnChangePassword}
                /></div>

                <div className="signErrorFoprm">

                </div>

                <div className="signUpFinishBtn">
                    <button
                    onClick={()=>{
                        erroDisplay();
                        error ?  <div><LoggedPage/></div>  : null }
                    }


                    >Finish</button>
                </div>
            </div>











        </div>




    )


}
export default SignUp;
